import React from 'react';
import { Link } from 'react-router-dom';
import { Grid, Typography, Button } from '@material-ui/core/';
import Cart from './Cart';

const Header = () => {
    return(
        <Grid container direction="row" justify="space-between" alignItems="center" xs={16}>
            <Link to="/"><Typography variant='h4'>Bootcamp Shop</Typography></Link>
            <Link to="/contato"><Button variant="outlined" color="secondary">Contato</Button></Link>
            <Cart />           
        </Grid>        
    )
}

export default Header;
